        string memory _auctionDesc,
        uint256 _relCommitDeadlineSec,
        uint256 _q,
        uint256 _p,
        uint256 _g
    ) public returns (Auction) {
        require(bytes(_auctionName).length > 0);
        // TODO: check group is valid (require efficient implementation of exponentiation)
